import styled from "styled-components";


export const StyledNav = styled.nav`
    background: black;
    color: red;
    height: 80px;
    margin-top: -25px;
    display: flex;
    justify-content: center;
    align-items: center;
    front-size: 5rem;
    position: sticky;
    top:0
    z-index: 10;


    h2 {color: blue;}
`
export const StyledNavLog = styled.nav`
    color red;
    

`
